import LoginForm from '../components/LoginForm'
import Header from '../components/Header';
import Footer from '../components/Footer';
import { Link } from 'react-router-dom';

function Login(){
    return(
        <div>
            <h1><Link to="/home">cook.ie</Link></h1>
            <LoginForm />
            <Footer />
        </div>
    );
}

export default Login;
